import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div style={styles.container}>
        <div style={styles.header}>
          <h1>üöÄ Admin Panel</h1>
          <p>Welcome to your website administration</p>
        </div>

        <div style={styles.stats}>
          <div style={styles.statCard}>
            <h3>üìù Blog Posts</h3>
            <p>12</p>
          </div>
          <div style={styles.statCard}>
            <h3>üíº Projects</h3>
            <p>8</p>
          </div>
          <div style={styles.statCard}>
            <h3>‚úâÔ∏è Messages</h3>
            <p>23</p>
          </div>
        </div>

        <div style={styles.navigation}>
          <button style={styles.navButton}>Blog Management</button>
          <button style={styles.navButton}>Project Management</button>
          <button style={styles.navButton}>Message Center</button>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
    padding: '2rem',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    textAlign: 'center',
    color: 'white',
    marginBottom: '3rem',
  },
  headerh1: {
    fontSize: '3rem',
    marginBottom: '1rem',
  },
  headerp: {
    fontSize: '1.2rem',
    opacity: 0.9,
  },
  stats: {
    display: 'flex',
    gap: '2rem',
    marginBottom: '3rem',
    flexWrap: 'wrap',
    justifyContent: 'center',
  },
  statCard: {
    background: 'rgba(255, 255, 255, 0.95)',
    padding: '2rem',
    borderRadius: '15px',
    textAlign: 'center',
    minWidth: '150px',
    boxShadow: '0 10px 30px rgba(0,0,0,0.2)',
  },
  statCardh3: {
    margin: '0 0 1rem 0',
    color: '#333',
  },
  statCardp: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#667eea',
    margin: 0,
  },
  navigation: {
    display: 'flex',
    gap: '1rem',
    flexWrap: 'wrap',
    justifyContent: 'center',
  },
  navButton: {
    background: 'white',
    border: 'none',
    padding: '1rem 2rem',
    borderRadius: '10px',
    fontSize: '1.1rem',
    fontWeight: '600',
    cursor: 'pointer',
    boxShadow: '0 5px 15px rgba(0,0,0,0.1)',
    transition: 'all 0.3s ease',
  },
  navButtonHover: {
    transform: 'translateY(-2px)',
    boxShadow: '0 8px 25px rgba(0,0,0,0.15)',
  },
};

export default App;
